function resizeBlocks(){blocks.forEach(function(a){a.setAttribute("style","height:"+a.offsetWidth+"px")})}function animatePhone(){var a=[].slice.call(document.getElementsByClassName("phone-svg"));a.forEach(function(a){var b=a.contentDocument,c=b.getElementById("phone");TweenLite.from(c,1,{x:"-=200px",autoAlpha:0})})}function animateMillennials(){var a=[].slice.call(document.getElementsByClassName("millennials"));a.forEach(function(a){var b=a.contentDocument,c=new TimelineLite,d=[3,0,4,1];for(var e in d){var f=b.getElementById("millennials-"+d[e]);c.to(f,1,{y:"-=25px"})}var g=b.getElementById("millennials_underline");c.to(g,1,{y:"-=25px"}),c.to(a,1,{y:"+=25px"})})}var blocks=[].slice.call(document.getElementsByClassName("block"));window.onresize=resizeBlocks,resizeBlocks(),window.onload=function(){animatePhone(),animateMillennials()};